import React from "react";
import NodeDataVisualizer from "./components/NodeDataVisualizer";
import SetThreshold from "./components/SetThreshold";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Smart Farm Dashboard</h1>
      </header>
      <main>
        <NodeDataVisualizer />
        <SetThreshold />
      </main>
    </div>
  );
}

export default App;
